import React, { Component } from 'react';
import PropTypes from 'prop-types';

const ToolBoxCard = (props) => {
	return <a target="_blank" href="https://www.toolboxproject.io" style={{left: props.positions.left, top: props.positions.top}} className="toolbox display-card"></a>
}

const LessonBoxCard = (props) => {
	return <a target="_blank" href="https://amaclean2.github.io" style={{left: props.positions.left, top: props.positions.top}} className="lessonbox display-card"></a>
}

const DevfestCard = (props) => {
	return <a target="_blank" href="https://devfestsf.com" style={{left: props.positions.left, top: props.positions.top}} className="devfest display-card"></a>
}

class Projects extends Component {
	constructor() {
		super()
		this.state = {
			cards: [
				{top: 100, left: 300},
				{top: 200, left: 100},
				{top: 600, left: 100}
			]
		}
	}

	render() {
	    return (<div className="Projects">
	    	<ToolBoxCard positions={this.state.cards[0]} />
	    	<LessonBoxCard positions={this.state.cards[1]} />
	    	<DevfestCard positions={this.state.cards[2]} />
	    </div>);
	}
}

Projects.propTypes = {
}

export default Projects;
